            cout<<a[1][j]<<" ";
    }
    return 0;
}
///_____SUBIECTUL III 3_____
void valuri(int &n, int v[])
{
    int k=0, i;
    n*=2;
    for(i=1; i<n; i=i+2)
        v[i]=i;
    for(i=n; i>1; i=i-2)
    {
        k+=2;
        v[i]=k;
    }
}
